    {
        path:'/about',
        display: 'About'
    },
    {
        path:'/tour',
        display: 'Tours'
    },
]
const quick__links2 =[
    {
        path:'/gallery',
        display: 'Home'
    },
    {
        path:'/login',
        display: 'Login'
    },
    {
        path:'/register',
        display: 'Register'
    },
]

const Footer = () => {
    return <footer className="footer">
        <Container>
            <Row>
                <Col lg='3'>
                    <div className="logo">
                        <img src={logo} alt="" />
                    </div>
                    <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Labore nesciunt officiis hic quam, necessitatibus quod provident tenetur.</p>
                    <div className="social__links d-flex align-items-center gap-4">
                        <span>
                            <Link to='#'><i class="ri-youtube-line"></i></Link>
                            <Link to='#'><i class="ri-github-fill"></i></Link>
                            <Link to='#'><i class="ri-youtube-line"></i></Link>
                            <Link to='#'><i class="ri-youtube-line"></i></Link>

                        </span>
                    </div>
                </Col>
            </Row>
        </Container>
    </footer>
}

export default Footer
